'use client';

import React, { useState, useMemo } from 'react';
import { Card } from '@/components/ui/card';
import Modal from '@/components/Modal';
import { useRouter, useSearchParams } from 'next/navigation';

interface Example {
  title: string;
  duration: string;
  tag: string;
  image: string;
}

const MarketingDashboard = () => {
  const [selectedExample, setSelectedExample] = useState<Example | null>(null);
  const [selectedFilter, setSelectedFilter] = useState<string | null>(null);
  const router = useRouter();
  const searchParams = useSearchParams();

  const handleCardClick = (example: Example) => {
    const currentPath = window.location.pathname; // Get the current path
    const params = new URLSearchParams(searchParams);
    params.set('title', example.title);

    router.replace(`${currentPath}?${params.toString()}`, undefined, { shallow: true });

    openModal(example);
  };

  const categories = [
    { title: 'ACQUISITION', items: ['Content', 'SEO', 'Sales', 'Social', 'Ads'] },
    { title: 'CONVERSION', items: ['Copywriting', 'Landing Page'] },
    { title: 'MORE', items: ['Retention', 'Brand', 'Referral', 'Creative'] },
    { title: 'NEWSLETTER', items: [] },
  ];

  const examples = [
    {
      title: 'Same interview. 700x reach.',
      duration: '30 secs',
      tag: 'Social',
      image: 'https://cdn.pixabay.com/photo/2016/02/01/00/56/news-1172463_640.jpg', // Dummy image
    },
    {
      title: 'Posting seltzer. Making money.',
      duration: '2 mins',
      tag: 'Creative',
      image: 'data:image/jpeg;base64,', // Dummy image
    },
    {
      title: 'The saleswoman closing 33% of cold pitches',
      duration: '2 min',
      tag: 'Sales',
      image: 'data:image/jpeg;base64,.jpg', // Dummy image
    },
    {
      title: 'A full-time "pizza influencer"',
      duration: '2 mins',
      tag: 'Content',
      image: 'data:image/png;base64,', // Dummy image
    },
    // Add more examples with images
  ];

  const filteredExamples = useMemo(() => {
    if (!selectedFilter) return examples;
    return examples.filter((example) => example.tag === selectedFilter);
  }, [selectedFilter, examples]);

  const openModal = (example: Example) => {
    setSelectedExample(example);
  };

  const closeModal = () => {
    setSelectedExample(null);
  };

  return (
    <div className="p-6 bg-gray-50 text-gray-800 min-h-screen">
      <header className="mb-8 flex flex-col sm:flex-row justify-between items-start sm:items-center">
        <h1 className="text-4xl font-bold tracking-tight text-gray-900 mb-4 sm:mb-0">
          My First Users
        </h1>
        <div className="flex flex-col sm:flex-row items-start sm:items-center space-y-2 sm:space-y-0 sm:space-x-4">
          <button className="bg-gray-300 hover:bg-gray-400 transition-colors px-5 py-2 rounded-lg text-sm text-gray-800 font-medium">
            Get 6 new tips in your inbox every Monday
          </button>
          <button className="bg-blue-700 hover:bg-blue-800 transition-colors px-5 py-2 rounded-lg text-sm font-semibold text-white">
            Yes Please :)
          </button>
        </div>
      </header>

      <div className="grid grid-cols-1 lg:grid-cols-6 gap-8">
        <div className="lg:col-span-1">
          {categories.map((category, index) => (
            <div key={index} className="mb-8">
              <h2 className="font-semibold text-xl mb-4 text-blue-700">
                {category.title}
              </h2>
              <div className="flex flex-wrap gap-3">
                {category.items.map((item, itemIndex) => (
                  <span
                    key={itemIndex}
                    className={`px-4 py-2 rounded-full text-sm cursor-pointer transition-colors ${
                      selectedFilter === item
                        ? 'bg-blue-700 text-white'
                        : 'bg-gray-300 hover:bg-gray-400 text-gray-800'
                    }`}
                    onClick={() =>
                      setSelectedFilter(selectedFilter === item ? null : item)
                    }
                  >
                    {item}
                  </span>
                ))}
              </div>
            </div>
          ))}
        </div>

        <div className="lg:col-span-5 grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-8">
          {filteredExamples.map((example, index) => (
            <Card
              key={index}
              className="bg-white hover:shadow-lg transition-shadow p-6 rounded-xl shadow-md cursor-pointer"
              onClick={() => handleCardClick(example)}
            >
              <img
                src={example.image}
                alt={example.title}
                className="w-full h-40 object-cover rounded-md mb-4"
              />
              <h3 className="font-semibold text-lg mb-2 text-blue-700">
                {example.title}
              </h3>
              <div className="flex justify-between items-center text-gray-600">
                <span className="text-sm">{example.duration}</span>
                <span className="bg-blue-700 px-4 py-1 rounded-full text-xs font-semibold text-white">
                  {example.tag}
                </span>
              </div>
            </Card>
          ))}
        </div>
      </div>

      {selectedExample && (
        <Modal title={selectedExample.title} onClose={closeModal}>
          <img
            src={selectedExample.image}
            alt={selectedExample.title}
            className="w-full h-60 object-cover rounded-md mb-4"
          />
          <p className="text-lg text-gray-700 mb-2">
            Duration: {selectedExample.duration}
          </p>
          <p className="text-lg text-gray-700">
            Tag: {selectedExample.tag}
          </p>
        </Modal>
      )}
    </div>
  );
};

export default MarketingDashboard;
